import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { emphasize, fade, darken, lighten } from '@material-ui/core/styles/colorManipulator';

import clsx from 'clsx';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Link from '@material-ui/core/Link';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Button from '@material-ui/core/Button';
import Drawer from '@material-ui/core/Drawer';
import logo from './../images/logo.png';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import AppsIcon from '@material-ui/icons/Apps';
import ListItemText from  '@material-ui/core/ListItemText';
import BusinessCenterIcon from '@material-ui/icons/BusinessCenter';
import LiveHelpIcon from '@material-ui/icons/LiveHelp';



const useStyles = makeStyles((theme) => ({
  toolbar: {
    justifyContent: 'center',
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  logo: {
    [theme.breakpoints.down('xs')]: {
      width: "60px",
    },
    [theme.breakpoints.up('md')]: {
      width: "80px",
    },
    [theme.breakpoints.up('lg')]: {
      width: "100px",
    },
  },
  secondaryButton: {
    marginRight: theme.spacing(2),
  },
  drawerContainer: {
    width: 256,
  }
}
));

function toggleDrawer(open) {

}

export default function Component(props) {
  const classes = useStyles();
  return (

<AppBar position="sticky" color="info">
  <Toolbar>
    <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu" onClick={toggleDrawer(true)}>
      <MenuIcon />
    </IconButton>
    <Link href="/" variant="h5" color="inherit" underline="none" className={classes.logo}>
      <img src={logo} alt="" width="80" />
    </Link>
    <Button color="inherit" className={classes.secondaryButton} ><Link to="/login">login</Link></Button>
    <Button variant="contained" color="primary">register</Button>
  </Toolbar>
  <Drawer anchor="left" onClose={toggleDrawer(false)}>
    <div className={classes.drawerContainer} color="secondary">
      <List>
        <ListItem button key="Features">
          <ListItemIcon>
            <AppsIcon />
          </ListItemIcon>
          <ListItemText primary="Features" />
        </ListItem>
        <ListItem button key="Enterprise">
          <ListItemIcon>
            <BusinessCenterIcon />
          </ListItemIcon>
          <ListItemText primary="Enterprise" />
        </ListItem>
        <ListItem button key="Support">
          <ListItemIcon>
            <LiveHelpIcon />
          </ListItemIcon>
          <ListItemText primary="Support" />
        </ListItem>
      </List>
    </div>
  </Drawer>
</AppBar>

  );
}
